import React from 'react';

const SearchBook = () => (
    <form action="/" method="get">
        <input
            type="text"
            id="header-search"
            placeholder="Search books"
            name="book"
        />
        <button 
            type="submit"
            className = "search">Search
        </button>
    </form>
);

export default SearchBook;
